import React from "react";
import penPath from "../images/pen.svg"

function Main(props) {
  return (
    <main>
      <section className="profile">
        <div className="profile__avatar-wrapper">
          <div className="profile__avatar-overlay">
            <img src={penPath} alt="" className="profile__avatar-overlay-image"/>
          </div>
          <img className="profile__avatar" src="#" alt="аватар"/>
        </div>
        <div className="profile__info">
          <div className="profile__info-wrapper">
            <h1 className="profile__info-name"></h1>
              <button className="profile__info-edit" type="button"></button>
          </div>
          <p className="profile__info-bio"></p>
        </div>
        <button className="profile__add-button" type="button"></button>
      </section>

      <section>
        <ul className="elements">
        </ul>
      </section>

    </main>
  )
}

function handleEditAvatarClick() {

}

function handleEditProfileClick() {
  document.querySelector(".popup_for-editing").classList.add('popup_active');
}

export default Main;
